var tipuesearch = {"pages": [{'title': 'About', 'text': '個人倉儲： https://github.com/Peichen1128/cad2023 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Brython', 'text': "https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation (Python 採 4 個 Spaces 縮排, 以界定執行範圍) \n Variables ( Python Keywords ) \n Comments (# 單行註解, 三個單引號或三個雙引號標註多行註解) \n Numbers \xa0 (整數 int(), 浮點數 float()) \n Strings \xa0 (字串) \n print (Python 內建函式, \xa0 print() \xa0 函式) \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt \xa0 動態頁面超文件). \n practice_html.txt \xa0 動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為 \xa0 class \xa0 後, 在範例導入時透過 \xa0 instance \xa0 引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:['./../cmsimde/static/','./../downloads/py/']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator \xa0 相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n Filename: \xa0 .py \xa0 \n \n \n \n Run \xa0 Output \xa0 清除輸出區 清除繪圖區 Reload \n \n \n \n \n \n \n \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block \n \n \n \n \n \n \n \n \n Filename: \xa0 .py \xa0 \n \n \n \n Run \xa0 Output \xa0 清除輸出區 清除繪圖區 Reload \n \n \n \n \n", 'tags': '', 'url': 'Brython.html'}, {'title': '網路設定', 'text': '在SCITE編輯器上修改副檔名 .ps1中的IPv6固定位址 ,確認自己的IPv6 address並修改上去。 \n \n \n \n 先從 這裡 確認你的班級序號 \n \n \n 下載 網路設定檔案 \n \n \n 同時下載 SCITE 編輯器: \xa0 wscite.7z \n \n \n 編輯修改 .ps1 中的 IPv6 固定位址, 放入自己的固定 IPv6 address \n \n \n \n', 'tags': '', 'url': '網路設定.html'}, {'title': '操作影片', 'text': '參考並詢問同組同學，實際操作並完成設定檔。   \n \n', 'tags': '', 'url': '操作影片.html'}, {'title': '動作解說', 'text': '原先為延用過去一年上隨身碟內原有的設定檔，但由於學校的網路更新後，只能手動操作，於W11週後使用新的設定檔，並自行設定。   \n 步驟一  從mde .tw中，找到home選單底下的reval。   \n \n    步驟二  往後翻找至 "有關網路設定 "，並下載網路設定檔。   \n \n        步驟三  下載後並解壓逤。   \n \n \n 步驟四  將資料夾中的 "1 _disable _ipv4 "從 "SciTE "打開。   \n    步驟五  修改內文的 " 2 0 0 1 : 2 8 8 : 6 0 0 4 : 1 7 : 2 0 2 3 : c a d b : :序號 "  序號至 https://mde.tw/cadnote/content/links.html \xa0查看並修改。 \n', 'tags': '', 'url': '動作解說.html'}, {'title': 'Wink', 'text': '學習如何利用 \xa0 Wink \xa0 製作電腦操作流程影片, 並將影片放入個人與分組網頁中. \n 首先使用者必須了解 \xa0 Wink \xa0 製作影片的功能與 \xa0 ShareX \xa0 相同, 都是依賴 \xa0 ffmpeg.exe . 意即使用 \xa0 Wink \xa0 之前必須在 Preferences 中先行設定 ffmpeg.exe 所在位置, 否則無法對所建立的專案轉為 mp4 檔案. \n 另外, 若擷取關鍵影格的電腦螢幕解析度大於 1008 x 630, 通常建立將影格 resize, 以方便使用者在手機上觀看影片. \n 利用 Wink 建立操作影片的步驟: \n \n 設定 ffmpeg.exe 所在位置, 若使用隨身碟中的可攜程式系統, 可將 ffmpeg.exe 放在 data 目錄中, 並以 wink_ffmpeg.reg 進行設定, 也可將 Wink 的啟動與 start_ipv6.bat 進行整合. \n 開啟 Wink 新專案. \n 每按下一次 Pause 鍵, 可擷取操作過程中的畫面影格 (利用 Zoomit 放大所要強調的操作內容, 並以紅線框列). \n 操作錄製結束後, 從右下方的 Tray 中, 以滑鼠左鍵點選, 在 Wink 圖示中, 以滑鼠右鍵帶出 Finish Capture 按鍵, 點選後即可回到 Wink 專案區. \n 在每一頁影格中加入註解說明 TextBox 之前, 先利用 Project - Resize All Frames 將影格縮小至 1008 x630. \n 完成註解說明後, 可以逐一移動各頁面滑鼠游標位置, 並決定各頁面影片播放時的停留時間. \n 最後以 Render 按鈕進行轉檔, 並利用 View Rendered Output 檢視所建立的操作影片. \n \n \n', 'tags': '', 'url': 'Wink.html'}, {'title': 'Wink操作影片', 'text': '', 'tags': '', 'url': 'Wink操作影片.html'}, {'title': 'W12', 'text': '', 'tags': '', 'url': 'W12.html'}, {'title': '座位表', 'text': '以下為參照 https://mde.tw/cadnote/downloads/2b_w12_seat.txt  及已知同學位置。 \n', 'tags': '', 'url': '座位表.html'}, {'title': '未登入資料名單', 'text': '41123219  \n 41123228  \n 41123244  \n 4 1123248  \n 4 1136126  \n 41136131 \n', 'tags': '', 'url': '未登入資料名單.html'}, {'title': '任務一', 'text': '個人分配到的是網頁維護兼組長 原先都是以使用Replit做更新動作，但由於Replit官方於約11 /20前後，推出新方案，減少一般未訂購方案用戶的CPU、RAM效能，以至於有段時間只能以Github的藏儲直接做程式修改。 \n', 'tags': '', 'url': '任務一.html'}, {'title': 'W7', 'text': '在建立組別的網站，不小心誤刪設定中Page裡所顯示的網址，透過Actions去做修復的動作。 \n 利用Actions(下圖畫面為點入後)，點選左邊的" pages-build-deployment" ，找到並點選錯誤的作動後，再點選"Re-run all job"，即完成回復動作。 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '段考週\u3000考試跟報告好多ＱＱ,努力維修中 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W10-11', 'text': '由於組別的網頁無法透過Replit更新，暫時經由Github進行直接修改。 \n 從Code頁面點選\'content\'選擇所要更改的部分。 \n \n 以下以更改組員名單並附上各位成員的個人網站連結為例。 \n 進入程式後，找到需修改的部分(圖中為名單主要部分)，在每人學號、姓名後面加上網址。 \n 新增 網址的 程式碼為： \n <h6><a href="個人網站網址"> 個人網站網址" </a></h6> \n *主要參照About中的倉儲連結打法 \n \n \n \n', 'tags': '', 'url': 'W10-11.html'}]};